import React from "react";
import s from "./Sound.module.css";

const Sound = () => {
    return (
        <div className={s.cont}>
            <div className={s.descr}>
                <h2 className={s.title}>Аккустическая система 1500ВТ</h2>
                <h3 className={s.subtitle}>RCF SUB 8003-A</h3>
                <p className={s.description}>
                    Серия ART 7 включает современные цифровые усилители
                    мощности, громкоговорители последнего поколения и
                    обеспечивает исключительное качество звука, обладая
                    достаточно простым управлением
                </p>
                <div className={s.prcie}>
                    <div className={s.price__descr}>
                        <p className={s.old__price}>3000 ₽</p>
                        <p className={s.current__price}>2500 ₽ *</p>
                    </div>
                    div 
                </div>
            </div>
            <div className={s.img}></div>
        </div>
    );
};

export default Sound;
